import React from 'react';
import './App.css';

const cities = [
  { name: "دبي", imageUrl: "https://www.aljazeera.net/wp-content/uploads/2014/11/a7f71861-8c3d-47cd-ba34-50b96aa010a7.jpeg?resize=686%2C513&quality=80" },
  { name: "القاهرة", imageUrl: "https://www.aljazeera.net/wp-content/uploads/2022/05/GettyImages-1160583342.jpg?resize=1920%2C1080" },
  { name: "باريس", imageUrl: "https://upload.wikimedia.org/wikipedia/commons/a/a6/Paris_Night.jpg" },
  { name: "إسطنبول", imageUrl: "https://upload.wikimedia.org/wikipedia/commons/0/00/Istanbul_panorama_2021.jpg" }
];

function App() {
  return (
    <div className="app">
      <h1>المدن السياحية</h1>
      <div className="grid">
        {cities.map((city, idx) => (
          <div key={idx} className="card">
            <img src={city.imageUrl} alt={city.name} />
            <h3>{city.name}</h3>
          </div>
        ))}
      </div>
    </div>
  );
}

export default App;
